import { Fragment } from 'react';

import { Layout } from '../components';
import { AppDownload, RequestService, OfficeSolution, BecomePartner } from '../components/Homepage';
import AppContext from '../components/AppContext';

function Homepage( props ) {
  return (
    <AppContext.Provider
      value={{
        isMobile: false
      }}
    >
      <Layout>
        <div className="Homepage">
          {
            !props.isMobile &&
              <Fragment>
                <AppDownload />
                <RequestService />
                <OfficeSolution />
                <BecomePartner />
              </Fragment>
          }
        </div>
      </Layout>
    </AppContext.Provider>
  );
}

export default Homepage;
